    private String code;
    private String name;
    private double latitude;
    private double longitude;
    private Language language;

    public BrowserLanguageConstant(String code, String name, Language language, double lon, double lat) {
        this.code = code;
        this.name = name;
        this.longitude = lon;
        this.latitude = lat;
        this.language = language;
        itemMap.put(code, this);
    }


    public static void init() {

    }

    public String getCode() {
        return code;
    }

    public String getName() {
        return name;
    }

    public double getLatitude() {
        return latitude;
    }

    public double getLongitude() {
        return longitude;
    }

    public BrowserLanguageConstant get(String code) {
        return itemMap.get(code);
    }
